import React from 'react';
import SwipeableViews from 'react-swipeable-views';

const BasicCarousel: React.FC = () => {
  return (
    <SwipeableViews>
      <span>slide 1</span>
      <span>slide 2</span>
      <span>slide 3</span>
    </SwipeableViews>
  );
}

export default BasicCarousel;
